e_enum_GpsActionType(V, Bin) -> e_varint(V, Bin).

e_type_int32(Value, Bin)
    when 0 =< Value, Value =< 127 ->
    <<Bin/binary, Value>>;
e_type_int32(Value, Bin) ->
    <<N:64/unsigned-native>> = <<Value:64/signed-native>>,
    e_varint(N, Bin).

e_type_string(S, Bin) ->
    Utf8 = unicode:characters_to_binary(S),
    Bin2 = e_varint(byte_size(Utf8), Bin),
    <<Bin2/binary, Utf8/binary>>.

e_type_bytes(Bytes, Bin) when is_binary(Bytes) ->
    Bin2 = e_varint(byte_size(Bytes), Bin),
    <<Bin2/binary, Bytes/binary>>;
e_type_bytes(Bytes, Bin) when is_list(Bytes) ->
    BytesBin = iolist_to_binary(Bytes),
    Bin2 = e_varint(byte_size(BytesBin), Bin),
    <<Bin2/binary, BytesBin/binary>>.

e_type_fixed32(Value, Bin) ->
    <<Bin/binary, Value:32/little>>.

e_type_fixed64(Value, Bin) ->
    <<Bin/binary, Value:64/little>>.

e_varint(N, Bin) when N =< 127 -> <<Bin/binary, N>>;
e_varint(N, Bin) ->
    Bin2 = <<Bin/binary, (N band 127 bor 128)>>,
    e_varint(N bsr 7, Bin2).



decode_msg(Bin, MsgName) when is_binary(Bin) ->
    decode_msg(Bin, MsgName, []).

decode_msg(Bin, MsgName, Opts) when is_binary(Bin) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'DeviceAlarm' -> d_msg_DeviceAlarm(Bin, TrUserData);
      'LightingClearSchedule' ->
	  d_msg_LightingClearSchedule(Bin, TrUserData);
      'CalendarEvent' -> d_msg_CalendarEvent(Bin, TrUserData);
      'LightingCtrl' -> d_msg_LightingCtrl(Bin, TrUserData);
      'LightingScheduledEvent' ->
	  d_msg_LightingScheduledEvent(Bin, TrUserData);
      'DeviceActionReq' ->
	  d_msg_DeviceActionReq(Bin, TrUserData);
      'GpsActionReq' -> d_msg_GpsActionReq(Bin, TrUserData);
      'LightingSetAuto' ->
	  d_msg_LightingSetAuto(Bin, TrUserData);
      'GpsSample' -> d_msg_GpsSample(Bin, TrUserData);
      'AstronomicalEvent' ->
	  d_msg_AstronomicalEvent(Bin, TrUserData);
      'LightingForceState' ->
	  d_msg_LightingForceState(Bin, TrUserData);
      'SensorSample' -> d_msg_SensorSample(Bin, TrUserData);
      'LightingAstronomicalEvent' ->
	  d_msg_LightingAstronomicalEvent(Bin, TrUserData);
      'SensorSampleReq' ->
	  d_msg_SensorSampleReq(Bin, TrUserData);
      'GpsActionRsp' -> d_msg_GpsActionRsp(Bin, TrUserData)
    end.



d_msg_DeviceAlarm(Bin, TrUserData) ->
    dfp_read_field_def_DeviceAlarm(Bin, 0, 0,
				   id(undefined, TrUserData),
				   id(undefined, TrUserData),
				   id(undefined, TrUserData), TrUserData).

dfp_read_field_def_DeviceAlarm(<<8, Rest/binary>>, Z1,
			       Z2, F1, F2, F3, TrUserData) ->
    d_field_DeviceAlarm_alarmType(Rest, Z1, Z2, F1, F2, F3,
				  TrUserData);
dfp_read_field_def_DeviceAlarm(<<16, Rest/binary>>, Z1,
			       Z2, F1, F2, F3, TrUserData) ->
    d_field_DeviceAlarm_alarmSeverity(Rest, Z1, Z2, F1, F2,
				      F3, TrUserData);
dfp_read_field_def_DeviceAlarm(<<26, Rest/binary>>, Z1,
			       Z2, F1, F2, F3, TrUserData) ->
    d_field_DeviceAlarm_msg(Rest, Z1, Z2, F1, F2, F3,
			    TrUserData);
dfp_read_field_def_DeviceAlarm(<<>>, 0, 0, F1, F2, F3,
			       _) ->
    #'DeviceAlarm'{alarmType = F1, alarmSeverity = F2,
		   msg = F3};
dfp_read_field_def_DeviceAlarm(Other, Z1, Z2, F1, F2,
			       F3, TrUserData) ->
    dg_read_field_def_DeviceAlarm(Other, Z1, Z2, F1, F2, F3,
				  TrUserData).

dg_read_field_def_DeviceAlarm(<<1:1, X:7, Rest/binary>>,
			      N, Acc, F1, F2, F3, TrUserData)
    when N < 32 - 7 ->
    dg_read_field_def_DeviceAlarm(Rest, N + 7,
				  X bsl N + Acc, F1, F2, F3, TrUserData);
dg_read_field_def_DeviceAlarm(<<0:1, X:7, Rest/binary>>,
			      N, Acc, F1, F2, F3, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      8 ->
	  d_field_DeviceAlarm_alarmType(Rest, 0, 0, F1, F2, F3,
					TrUserData);
      16 ->
	  d_field_DeviceAlarm_alarmSeverity(Rest, 0, 0, F1, F2,
					    F3, TrUserData);
      26 ->
	  d_field_DeviceAlarm_msg(Rest, 0, 0, F1, F2, F3,
				  TrUserData);
      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_DeviceAlarm(Rest, 0, 0, F1, F2, F3,
					TrUserData);
	    1 ->
		skip_64_DeviceAlarm(Rest, 0, 0, F1, F2, F3, TrUserData);
	    2 ->
		skip_length_delimited_DeviceAlarm(Rest, 0, 0, F1, F2,
						  F3, TrUserData);
	    5 ->
		skip_32_DeviceAlarm(Rest, 0, 0, F1, F2, F3, TrUserData)
	  end
    end;
dg_read_field_def_DeviceAlarm(<<>>, 0, 0, F1, F2, F3,
			      _) ->
    #'DeviceAlarm'{alarmType = F1, alarmSeverity = F2,
		   msg = F3}.

d_field_DeviceAlarm_alarmType(<<1:1, X:7, Rest/binary>>,
			      N, Acc, F1, F2, F3, TrUserData)
    when N < 57 ->
    d_field_DeviceAlarm_alarmType(Rest, N + 7,
				  X bsl N + Acc, F1, F2, F3, TrUserData);
d_field_DeviceAlarm_alarmType(<<0:1, X:7, Rest/binary>>,
			      N, Acc, _, F2, F3, TrUserData) ->
    <<Tmp:32/signed-native>> = <<(X bsl N +
				    Acc):32/unsigned-native>>,
    NewFValue = d_enum_AlarmType(Tmp),
    dfp_read_field_def_DeviceAlarm(Rest, 0, 0, NewFValue,
				   F2, F3, TrUserData).


d_field_DeviceAlarm_alarmSeverity(<<1:1, X:7,
				    Rest/binary>>,
				  N, Acc, F1, F2, F3, TrUserData)
    when N < 57 ->
    d_field_DeviceAlarm_alarmSeverity(Rest, N + 7,
				      X bsl N + Acc, F1, F2, F3, TrUserData);
d_field_DeviceAlarm_alarmSeverity(<<0:1, X:7,
				    Rest/binary>>,
				  N, Acc, F1, _, F3, TrUserData) ->
    <<Tmp:32/signed-native>> = <<(X bsl N +
				    Acc):32/unsigned-native>>,
    NewFValue = d_enum_AlarmSeverity(Tmp),
    dfp_read_field_def_DeviceAlarm(Rest, 0, 0, F1,
				   NewFValue, F3, TrUserData).


d_field_DeviceAlarm_msg(<<1:1, X:7, Rest/binary>>, N,
			Acc, F1, F2, F3, TrUserData)
    when N < 57 ->
    d_field_DeviceAlarm_msg(Rest, N + 7, X bsl N + Acc, F1,
			    F2, F3, TrUserData);
d_field_DeviceAlarm_msg(<<0:1, X:7, Rest/binary>>, N,
			Acc, F1, F2, _, TrUserData) ->
    Len = X bsl N + Acc,
    <<Bytes:Len/binary, Rest2/binary>> = Rest,
    NewFValue = binary:copy(Bytes),
    dfp_read_field_def_DeviceAlarm(Rest2, 0, 0, F1, F2,
				   NewFValue, TrUserData).


skip_varint_DeviceAlarm(<<1:1, _:7, Rest/binary>>, Z1,
			Z2, F1, F2, F3, TrUserData) ->
    skip_varint_DeviceAlarm(Rest, Z1, Z2, F1, F2, F3,
			    TrUserData);
skip_varint_DeviceAlarm(<<0:1, _:7, Rest/binary>>, Z1,
			Z2, F1, F2, F3, TrUserData) ->
    dfp_read_field_def_DeviceAlarm(Rest, Z1, Z2, F1, F2, F3,
				   TrUserData).


skip_length_delimited_DeviceAlarm(<<1:1, X:7,
				    Rest/binary>>,
				  N, Acc, F1, F2, F3, TrUserData)
    when N < 57 ->
    skip_length_delimited_DeviceAlarm(Rest, N + 7,
				      X bsl N + Acc, F1, F2, F3, TrUserData);
skip_length_delimited_DeviceAlarm(<<0:1, X:7,
