skip_32_DeviceAlarm(<<_:32, Rest/binary>>, Z1, Z2, F1,
		    F2, F3, TrUserData) ->
    dfp_read_field_def_DeviceAlarm(Rest, Z1, Z2, F1, F2, F3,
