	    5 ->
		skip_32_CalendarEvent(Rest, 0, 0, F1, F2, F3, F4, F5,
				      F6, F7, TrUserData)
	  end
    end;
dg_read_field_def_CalendarEvent(<<>>, 0, 0, F1, F2, F3,
				F4, F5, F6, F7, _) ->
    #'CalendarEvent'{sec = F1, min = F2, hr = F3, wday = F4,
		     mday = F5, mon = F6, year = F7}.

