merge_msgs(Prev, New) -> merge_msgs(Prev, New, []).

merge_msgs(Prev, New, Opts)
    when element(1, Prev) =:= element(1, New) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Prev of
      #'DeviceAlarm'{} ->
	  merge_msg_DeviceAlarm(Prev, New, TrUserData);
      #'LightingClearSchedule'{} ->
	  merge_msg_LightingClearSchedule(Prev, New, TrUserData);
      #'CalendarEvent'{} ->
	  merge_msg_CalendarEvent(Prev, New, TrUserData);
      #'LightingCtrl'{} ->
	  merge_msg_LightingCtrl(Prev, New, TrUserData);
      #'LightingScheduledEvent'{} ->
	  merge_msg_LightingScheduledEvent(Prev, New, TrUserData);
      #'DeviceActionReq'{} ->
	  merge_msg_DeviceActionReq(Prev, New, TrUserData);
      #'GpsActionReq'{} ->
	  merge_msg_GpsActionReq(Prev, New, TrUserData);
      #'LightingSetAuto'{} ->
	  merge_msg_LightingSetAuto(Prev, New, TrUserData);
      #'GpsSample'{} ->
	  merge_msg_GpsSample(Prev, New, TrUserData);
      #'AstronomicalEvent'{} ->
	  merge_msg_AstronomicalEvent(Prev, New, TrUserData);
      #'LightingForceState'{} ->
	  merge_msg_LightingForceState(Prev, New, TrUserData);
      #'SensorSample'{} ->
	  merge_msg_SensorSample(Prev, New, TrUserData);
      #'LightingAstronomicalEvent'{} ->
	  merge_msg_LightingAstronomicalEvent(Prev, New,
					      TrUserData);
      #'SensorSampleReq'{} ->
	  merge_msg_SensorSampleReq(Prev, New, TrUserData);
      #'GpsActionRsp'{} ->
	  merge_msg_GpsActionRsp(Prev, New, TrUserData)
    end.

merge_msg_DeviceAlarm(#'DeviceAlarm'{msg = PFmsg},
		      #'DeviceAlarm'{alarmType = NFalarmType,
				     alarmSeverity = NFalarmSeverity,
				     msg = NFmsg},
		      _) ->
    #'DeviceAlarm'{alarmType = NFalarmType,
		   alarmSeverity = NFalarmSeverity,
		   msg =
		       if NFmsg =:= undefined -> PFmsg;
			  true -> NFmsg
		       end}.

merge_msg_LightingClearSchedule(_Prev, New,
				_TrUserData) ->
    New.

merge_msg_CalendarEvent(#'CalendarEvent'{wday = PFwday,
					 mday = PFmday, mon = PFmon,
