verify_msg(Msg) -> verify_msg(Msg, []).

verify_msg(Msg, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case Msg of
      #'DeviceAlarm'{} ->
	  v_msg_DeviceAlarm(Msg, ['DeviceAlarm'], TrUserData);
      #'LightingClearSchedule'{} ->
	  v_msg_LightingClearSchedule(Msg,
				      ['LightingClearSchedule'], TrUserData);
      #'CalendarEvent'{} ->
	  v_msg_CalendarEvent(Msg, ['CalendarEvent'], TrUserData);
      #'LightingCtrl'{} ->
	  v_msg_LightingCtrl(Msg, ['LightingCtrl'], TrUserData);
      #'LightingScheduledEvent'{} ->
	  v_msg_LightingScheduledEvent(Msg,
				       ['LightingScheduledEvent'], TrUserData);
      #'DeviceActionReq'{} ->
	  v_msg_DeviceActionReq(Msg, ['DeviceActionReq'],
				TrUserData);
      #'GpsActionReq'{} ->
	  v_msg_GpsActionReq(Msg, ['GpsActionReq'], TrUserData);
      #'LightingSetAuto'{} ->
	  v_msg_LightingSetAuto(Msg, ['LightingSetAuto'],
				TrUserData);
      #'GpsSample'{} ->
	  v_msg_GpsSample(Msg, ['GpsSample'], TrUserData);
      #'AstronomicalEvent'{} ->
	  v_msg_AstronomicalEvent(Msg, ['AstronomicalEvent'],
				  TrUserData);
      #'LightingForceState'{} ->
	  v_msg_LightingForceState(Msg, ['LightingForceState'],
				   TrUserData);
      #'SensorSample'{} ->
	  v_msg_SensorSample(Msg, ['SensorSample'], TrUserData);
      #'LightingAstronomicalEvent'{} ->
	  v_msg_LightingAstronomicalEvent(Msg,
					  ['LightingAstronomicalEvent'],
					  TrUserData);
      #'SensorSampleReq'{} ->
	  v_msg_SensorSampleReq(Msg, ['SensorSampleReq'],
				TrUserData);
      #'GpsActionRsp'{} ->
	  v_msg_GpsActionRsp(Msg, ['GpsActionRsp'], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


